import React from 'react';

function CardList({ cards }) {
  return (
    <div>
      <h2>Cartas cargadas</h2>
      <ul>
        {cards.map((card, index) => (
          <li key={index}>
            {card.name} ({card.type})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default CardList;
